import React, { Fragment } from "react";
import { Helmet } from "react-helmet";

const Home = () => (
  <Fragment>
    <Helmet>
      <title>Kviz</title>
    </Helmet>
    <div id="home">
      <section>
        <h1>Osnove Programiranja</h1>
      </section>
    </div>
  </Fragment>
);

export default Home;
